import React from "react";

import Routes from "./components/routes";
import UserContext from "./UserContext";

const App = () => {
  const [user, setUser] = React.useState(undefined);

  return (
    <UserContext.Provider value={{ user, setUser }}>
      <Routes />
    </UserContext.Provider>
  );
};

export default App;
